import React, { useEffect, useState } from "react";
const URL = "https://js-course-server.onrender.com/quotes/get-all-quotes";

function AllQuoteTest() {
  const [quote, setQuote] = useState([]);

  useEffect(() => {
    fetch(URL)
      .then((data) => data.json())
      .then((res) => setQuote(res))
      .catch((err) => console.log(err));
  }, []);
  console.log(quote);
  return (
    <div>
      {quote.map((citat) => {
        return <div key={citat._id}
        style={{
            border:'solid 1px black',
            padding: '10px',
            backgroundColor:'aqua',
            margin: "10px"
        }}
        >
            <h1>{citat.quoteAuthor} </h1>
            <h1>{citat.quoteSource}</h1>
            <h1>{citat.quoteText} </h1>
        </div>;
      })}
    </div>
  );
}

export default AllQuoteTest;
